import styled from "styled-components";

export const NavbarContainer = styled.div`
height:100px;
margin:0;
`
export const NavbarWrapper = styled.div`
height:100%;
width:100%auto;
display:flex;
justify-content:center;
align-items:center;
`
export const NavLogo = styled.div`
font-size: clamp(1.5rem, 5vw, 3rem)
`
